<script>

    var years = {
        2006: {},

    };

    var incomeGraph;

    var min_income = Number.MAX_SAFE_INTEGER;

    d3.tsv("/ato_data.tsv", function(d) {

            min_income = blob.average_income;
        }

            max_income = blob.average_income;
        }
